    /// Encodes the packet payload into a game frame: `[0xFE] [Length] [Header] [Body]`.
    pub fn encode_game_frame<B: bytes::BufMut>(
        &self,
        buf: &mut B,
        from_subclient: u32,
        to_subclient: u32,
    ) -> Result<(), std::io::Error> {
        buf.put_u8(GAME_PACKET_ID);
        self.encode_inner(buf, from_subclient, to_subclient)
    }
